import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    username:"alperensahin",
    posts:[
      {title:"Twitter",releaseDate:"20.09.2020",releaseTime:"20:00",size:"16:10",imgData:"data:image/png;base64,"}
    ],
    leastPost:12,
    img:null,
  },
  mutations: {
    setUser (state,user) {
      state.username = user;
    },
    pushPost(state,post){
      state.leastPost--;
      state.posts.push(post);
    },
    setImage(state,img){
      state.img = img;
    }
  },
  actions: {
  },
  modules: {
  }
})
